import React from 'react'
import './index.css'


function Online_Modal(props) {
    console.log(JSON.stringify(props));
    return (
        <div>
                <div><b>Task_Description:</b>{props.data.Description}</div>
                <div><b>Image:</b><img src={props.data.Image} style={{ width: '100px', height: '100px' }} /></div>
                <div><b>Due_Date:</b> {props.data.Date}</div>
                <div><b>Payment_Type:</b> {props.data.Payment_type}</div>
                <div><b>Budget:</b> ${props.data.Budget}</div>
            </div>


    )
}

export default Online_Modal
